import React from 'react';

const Specifications = () => {
  return (
    <main>
      <section>
        <h2>Lab Specifications</h2>
        <p>This page will contain detailed information about the specifications of various labs at SRM KTR campus.</p>
      </section>
    </main>
  );
};

export default Specifications;
